// src/components/EmployeeList.js
import React, { useState, useEffect } from 'react';
import { Card, CardContent, Typography, Grid, Button, Dialog, DialogTitle, DialogContent, DialogActions, TextField } from '@mui/material';
import ApiService from '../services/ApiService';

const EmployeeList = () => {
    const [employees, setEmployees] = useState([]);
    const [openAddEmployeeDialog, setOpenAddEmployeeDialog] = useState(false);
    const [newEmployee, setNewEmployee] = useState({ id: '', name: '', managerID: '', email: '' });
    const [selectedEmployee, setSelectedEmployee] = useState(null);
    const [deleteResult, setDeleteResult] = useState(null);
    const [isInfoDialogOpen, setIsInfoDialogOpen] = useState(false);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await ApiService.getEmployees();
                setEmployees(response.data);
            } catch (error) {
                console.error('Error fetching employees:', error);
            }
        };

        fetchData();
    }, []);

    const handleAddEmployeeClick = () => {
        setOpenAddEmployeeDialog(true);
    };

    const handleDialogClose = () => {
        setOpenAddEmployeeDialog(false);
        setDeleteResult(null);
        setSelectedEmployee(null);
    };
    const handleInfoDialogClose = () => {
        setIsInfoDialogOpen(false);
        setSelectedEmployee(null);
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setNewEmployee({ ...newEmployee, [name]: value });
    };

    const handleAddEmployee = async () => {
        try {
            await ApiService.addEmployee(newEmployee);
            const response = await ApiService.getEmployees();
            setEmployees(response.data);
            setOpenAddEmployeeDialog(false);
            setNewEmployee({ id: '', name: '', managerID: '', email: '' });
        } catch (error) {
            console.error('Error adding employee:', error);
        }
    };
    const handleDeleteEmployeeClick = (employee) => {
        setSelectedEmployee(employee);
        setDeleteResult(null);
    };

    const handleDeleteEmployee = async () => {
        try {
            await ApiService.deleteEmployee(selectedEmployee.id);
            const response = await ApiService.getEmployees();
            setEmployees(response.data);
            setDeleteResult('Employee deleted successfully.');
        } catch (error) {
            console.error('Error deleting employee:', error);
            setDeleteResult('Error deleting employee.');
        }
    };

    const handleShowInfoClick = async (employee) => {
        try {
            const response = await ApiService.getEmployee(employee.id);
            // Aici poți folosi datele obținute pentru a afișa informații detaliate despre angajat
            console.log('Employee details:', response.data);
            setSelectedEmployee(employee);
            setIsInfoDialogOpen(true);
        } catch (error) {
            console.error('Error fetching employee details:', error);
        }
    };

    return (
        <div>
            <Grid container spacing={2}>
                {employees.map(employee => (
                    <Grid item xs={12} sm={6} md={4} lg={3} key={employee.id}>
                        <Card>
                            <CardContent>
                                <Typography variant="h6" gutterBottom>
                                    {employee.name}
                                </Typography>
                                <Button
                                    variant="outlined"
                                    color="secondary"
                                    onClick={() => handleDeleteEmployeeClick(employee)}
                                >
                                    Delete Employee
                                </Button>
                                <Button
                                    variant="outlined"
                                    color="primary"
                                    onClick={() => handleShowInfoClick(employee)}
                                >
                                    Show All Info
                                </Button>
                            </CardContent>
                        </Card>
                    </Grid>
                ))}
            </Grid>
            <Button variant="contained" color="primary" onClick={handleAddEmployeeClick}>
                Add Employee
            </Button>
            <Dialog open={openAddEmployeeDialog} onClose={handleDialogClose}>
                <DialogTitle>Add Employee</DialogTitle>
                <DialogContent>
                    <TextField
                        label="ID"
                        name="id"
                        value={newEmployee.id}
                        onChange={handleInputChange}
                        fullWidth
                        margin="normal"
                    />
                    <TextField
                        label="Name"
                        name="name"
                        value={newEmployee.name}
                        onChange={handleInputChange}
                        fullWidth
                        margin="normal"
                    />
                    <TextField
                        label="Manager ID"
                        name="managerID"
                        value={newEmployee.managerID}
                        onChange={handleInputChange}
                        fullWidth
                        margin="normal"
                    />
                    <TextField
                        label="Email"
                        name="email"
                        value={newEmployee.email}
                        onChange={handleInputChange}
                        fullWidth
                        margin="normal"
                    />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleDialogClose}>Cancel</Button>
                    <Button color="primary" onClick={handleAddEmployee}>
                        Add
                    </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
};

export default EmployeeList;
